import React, { Component } from 'react';
import CardExito from './CardExito/CardExito';
import Button from '../Button/Button';
import design from './diseño.svg';
import proceso from './proceso.svg';
import ajuste from './ajuste.svg';

import './Exito.css';

class Process extends Component {
    constructor(props){
        super(props);
        this.state = {

        }
    }

    render (){

    const uno = 'User Experience';
    const dos = 'eeee';
    const tres = 'Insights';
    const cuatro = 'eeee';
    const cinco = 'Agil';




    const unoContent = 'Envianos tu idea y diseñaremos un plan que se adapte a ti';
    const dosContent = 'Desarrollamos tu producto y validaremos los resultados.';
    const tresContent = 'Ajusteremos acorde los resultados hasta alcanzar tus objetivos.';
    const cuatroContent = '';
    const cincoContent =  '';


    const estilo = 'center luz br4 mv3 mh3 ba b--black-10 w-15-l w-100 grow mh2';

    const gretting1 = 'Descubre';
    const gretting = 'Hablemos';

    const estiloButton1 = 'br3-ns br3 ba color-boton1 ttu white center pt2 pb2 pr4 pl4 f5 f3-ns no-underline grow';
    const estiloButton2 = 'br3-ns br3 ba color-boton2 ttu white center pt2 pb2 pr4 pl4 f5 f3-ns no-underline grow';


    return (

        <div id='exito' className='vh-100-l flex flex-column items-center img-back2 tc'>
            <p className='fw1 f3 f1-ns lh-title mv3 pt6'>Descubre el exito</p>
            <div  className='flex justify-center-ns flex-wrap items-center w-90 center '>
                <CardExito text = {uno}  content = {unoContent} estilo = {estilo} image={design}/> 
                <CardExito text = {dos}   content = {dosContent} estilo = {estilo} image={proceso}/>
                <CardExito text = {tres}  content = {tresContent} estilo = {estilo} image={ajuste}/>
                <CardExito text = {cuatro}   content = {cuatroContent} estilo = {estilo} image={proceso}/>
                <CardExito text = {cinco}  content = {cincoContent} estilo = {estilo} image={ajuste}/>
            </div>

            <div className='flex center flex-wrap justify-center mt5'>
                        <div  className='mh2 mb3' >
                            <Button text = {gretting1}  estilo = {estiloButton1} onSumbitSubscription = {this.onSumbitSubscription} />
                        </div>
                        <div  className='mh2 mb3' >
                            <Button text = {gretting}  estilo = {estiloButton2} onSumbitSubscription = {this.onSumbitSubscription} />
                        </div>    
            </div>

            <div className='tc flex center justify-center '>

                <a href="#calltoaction" className="arrow"> 
                    <svg className="icon icon-arrow-down" width="60" height="60" viewBox="0 0 32 32"> 
                        <g id="icon-arrow-down">
                            <path className="path1" d="M4.131 8.962c-0.434-0.429-1.134-0.429-1.566 0-0.432 0.427-0.432 1.122 0 1.55l12.653 12.528c0.434 0.429 1.133 0.429 1.566 0l12.653-12.528c0.432-0.429 0.434-1.122 0-1.55s-1.136-0.429-1.566-0.002l-11.87 11.426-11.869-11.424z" 
                            fill="#B60D35" 
                            ></path>
                        </g>
                    </svg> 
                </a>
            </div>




        </div>




    );

    }
    }

    export default Process;
